import React from "react";
import { Carousel } from "react-responsive-carousel";

function Home() {
  const randimg = [
    {
      img: "https://picsum.photos/seed/img1/1000/400",
      alt: "cor1",
    },
    {
      img: "https://picsum.photos/seed/img2/1000/400",
      alt: "cor2",
    },
    {
      img: "https://picsum.photos/seed/img4/1000/400 ",
      alt: "cor3",
    },
  ];
  return (
    <Carousel>
      {randimg.map((item, index) => (
        <div key={index} className="flex justify-center items-center relative">
          <img src={item.img} alt={item.alt} />
          <p className="legend"></p>
        </div>
      ))}
    </Carousel>
  );
}

export default Home;
